import React from 'react';
import {useState, useEffect} from 'react';
import Axios from 'axios';
import Navigation from '../components/Navigation';
import LoginDataTable from '../components/LoginDataTable'
import Footer from '../components/Footer';
import SearchBar from '../components/SearchBar';

export function ViewAll() {
  
  const [loginList, setLoginList] = useState([])

  useEffect(() => {
    Axios.get("http://localhost:4500/view-all").then((response) => {
      setLoginList(response.data)
    })
}, []);

  function searchLogins(e) {
    e.preventDefault();
    console.log(e.currrentTarget.value)
  }
  
  return (
    <div>
      <Navigation />
      <div className ="main-content">
        <div className="block-container">
          <div className="block-container-inner">
            <SearchBar 
              searchFunction={searchLogins}/>
            <div className="form-field-container">
              <h3>View All</h3>
              <LoginDataTable 
                logins={loginList} />
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default ViewAll;
